function Destination({ destination }) {
    const {id, name, description, image} = destination
  return (
    <div>
  <div className="max-w-md rounded-lg shadow-lg bg-white text-center mx-auto p-6 my-8 border border-gray-200">
    <li>
      <h2 className="text-2xl font-semibold text-gray-800 truncate block capitalize mb-4">
        {name}
      </h2>
      <img
        className="w-full h-60 object-cover rounded-lg mb-4"
        src={image}
        alt={name}
      />
      <p className="text-gray-700 text-base mb-4">{description}</p>

      <hr className="border-gray-300 my-4" />

    </li>
  </div>
</div>

  )
}

export default Destination
